import React from 'react'

const ProjectNav = ({dataItems}) => {
    const {category, id} = dataItems
    return (
        <nav style={{color: 'white'}}>
            {category.map((name, index) => {
                <h1 key={index}>{name}</h1>
            })}
        </nav>
    )
}

export default ProjectNav
